// id values will be unique
const items = [
    { name: 'Milk', quantity: 2,  unit: "Oz" },
    { name: 'Watermellon', quantity: 1, unit: "ct" },
	{ name: 'Eggs', quantity: 1 , unit: "dozen"},
	{ name: 'Bread', quantity: 1 , unit: "ct"},
	{ name: 'cheese', quantity: 2,  unit: "Oz" },
    { name: 'Pumpkin', quantity: 1, unit: "ct" },
	{ name: 'Chili Powder', quantity: 16 , unit: "Oz"},
	{ name: 'Chicken', quantity: 1 , unit: "lb"},
];

export default items;
